import React, { useState, useEffect } from 'react';
import { 
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  ResponsiveContainer, PieChart, Pie, Cell, BarChart, Bar 
} from 'recharts';
import { 
  TrendingUp, Users, AlertTriangle, CreditCard, 
  BarChart3, Calendar, Download, RefreshCw 
} from 'lucide-react';

const Analytics = () => {
  const [loading, setLoading] = useState(true);
  const [analyticsData, setAnalyticsData] = useState(null);
  const [trends, setTrends] = useState(null);
  const [churnPredictions, setChurnPredictions] = useState([]);
  const [demandForecast, setDemandForecast] = useState([]);
  const [timeRange, setTimeRange] = useState(30);

  useEffect(() => {
    fetchAnalyticsData();
  }, [timeRange]);

  const fetchAnalyticsData = async () => {
    setLoading(true);
    try {
      // Fetch analytics summary
      const summaryResponse = await fetch(`${process.env.REACT_APP_ML_SERVICE_URL}/analytics/summary`);
      const summaryData = await summaryResponse.json();

      // Fetch trends
      const trendsResponse = await fetch(`${process.env.REACT_APP_ML_SERVICE_URL}/analytics/trends?days=${timeRange}`);
      const trendsData = await trendsResponse.json();

      // Fetch churn predictions
      const churnResponse = await fetch(`${process.env.REACT_APP_ML_SERVICE_URL}/predict/churn`);
      const churnData = await churnResponse.json();

      // Fetch demand forecast
      const forecastResponse = await fetch(`${process.env.REACT_APP_ML_SERVICE_URL}/forecast/demand?days=7`);
      const forecastData = await forecastResponse.json();

      setAnalyticsData(summaryData.summary);
      setTrends(trendsData.trends);
      setChurnPredictions(churnData.predictions || []);
      setDemandForecast(forecastData.forecast || []);
    } catch (error) {
      console.error('Error fetching analytics data:', error);
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ title, value, icon: Icon, color, trend }) => (
    <div className="bg-white rounded-lg shadow-md p-6 border-l-4" style={{ borderLeftColor: color }}>
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm font-medium text-gray-600">{title}</p>
          <p className="text-2xl font-bold text-gray-900">{value}</p>
          {trend && (
            <p className={`text-sm ${trend > 0 ? 'text-green-600' : 'text-red-600'}`}>
              {trend > 0 ? '+' : ''}{trend}% from last period
            </p>
          )}
        </div>
        <Icon className="h-8 w-8" style={{ color }} />
      </div>
    </div>
  );

  const COLORS = ['#FF6B6B', '#4ECDC4', '#45B7D1', '#96CEB4', '#FFEAA7'];

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <RefreshCw className="h-8 w-8 animate-spin text-blue-500" />
        <span className="ml-2 text-lg">Loading analytics...</span>
      </div>
    );
  }

  const churnRiskData = analyticsData ? [
    { name: 'High Risk', value: analyticsData.churn_risk.high, color: '#FF6B6B' },
    { name: 'Medium Risk', value: analyticsData.churn_risk.medium, color: '#FFEAA7' },
    { name: 'Low Risk', value: analyticsData.churn_risk.low, color: '#96CEB4' }
  ] : [];

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="flex justify-between items-center mb-6">
          <div>
            <h1 className="text-3xl font-bold text-gray-900">Analytics Dashboard</h1>
            <p className="text-gray-600">Comprehensive insights into rider behavior and system performance</p>
          </div>
          <div className="flex space-x-3">
            <select 
              value={timeRange} 
              onChange={(e) => setTimeRange(Number(e.target.value))}
              className="px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500"
            >
              <option value={7}>Last 7 days</option>
              <option value={30}>Last 30 days</option>
              <option value={90}>Last 90 days</option>
            </select>
            <button 
              onClick={fetchAnalyticsData}
              className="flex items-center px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
            >
              <RefreshCw className="h-4 w-4 mr-2" />
              Refresh
            </button>
            <button className="flex items-center px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700">
              <Download className="h-4 w-4 mr-2" />
              Export
            </button>
          </div>
        </div>

        {/* Key Metrics */}
        {analyticsData && (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
            <StatCard
              title="Total Riders"
              value={analyticsData.total_riders.toLocaleString()}
              icon={Users}
              color="#4ECDC4"
            />
            <StatCard
              title="High Churn Risk"
              value={analyticsData.churn_risk.high}
              icon={AlertTriangle}
              color="#FF6B6B"
            />
            <StatCard
              title="Daily Avg Swaps"
              value={analyticsData.recent_activity.daily_average}
              icon={TrendingUp}
              color="#45B7D1"
            />
            <StatCard
              title="Payment Success Rate"
              value={`${analyticsData.payment_stats.success_rate}%`}
              icon={CreditCard}
              color="#96CEB4"
            />
          </div>
        )}

        {/* Charts Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 mb-8">
          {/* Churn Risk Distribution */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-semibold mb-4">Churn Risk Distribution</h3>
            <ResponsiveContainer width="100%" height={300}>
              <PieChart>
                <Pie
                  data={churnRiskData}
                  cx="50%"
                  cy="50%"
                  labelLine={false}
                  label={({ name, percent }) => `${name}: ${(percent * 100).toFixed(0)}%`}
                  outerRadius={80}
                  fill="#8884d8"
                  dataKey="value"
                >
                  {churnRiskData.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={entry.color} />
                  ))}
                </Pie>
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
          </div>

          {/* Swap Trends */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-semibold mb-4">Daily Swap Activity</h3>
            {trends && trends.daily_swaps && (
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={trends.daily_swaps}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="_id" />
                  <YAxis />
                  <Tooltip />
                  <Legend />
                  <Line type="monotone" dataKey="count" stroke="#4ECDC4" strokeWidth={2} />
                </LineChart>
              </ResponsiveContainer>
            )}
          </div>
        </div>

        {/* Demand Forecast */}
        <div className="bg-white rounded-lg shadow-md p-6 mb-8">
          <h3 className="text-lg font-semibold mb-4">7-Day Demand Forecast</h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={demandForecast}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="predicted_swaps" fill="#45B7D1" name="Predicted Swaps" />
              <Bar dataKey="lower_bound" fill="#96CEB4" name="Lower Bound" />
              <Bar dataKey="upper_bound" fill="#FFEAA7" name="Upper Bound" />
            </BarChart>
          </ResponsiveContainer>
        </div>

        {/* High Risk Riders Table */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h3 className="text-lg font-semibold mb-4">High Risk Riders</h3>
          <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Rider ID
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Risk Level
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Probability
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Action
                  </th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {churnPredictions
                  .filter(rider => rider.risk === 'high')
                  .slice(0, 10)
                  .map((rider, index) => (
                    <tr key={index}>
                      <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                        {rider.riderId}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className="inline-flex px-2 py-1 text-xs font-semibold rounded-full bg-red-100 text-red-800">
                          {rider.risk}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                        {(rider.probability * 100).toFixed(1)}%
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        <button className="text-blue-600 hover:text-blue-900">
                          Send Retention Offer
                        </button>
                      </td>
                    </tr>
                  ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Analytics;
